        .fontSize($r('app.float.font_size_S'))
        .fontWeight(this.currentIndex === index ? 500 : 400)
    }
    .justifyContent(FlexAlign.End)
    .width(CommonConstants.FULL_LENGTH)
  }

  pageTransition() {
    // 定义页面进入时的效果，从底侧滑入，时长为1200ms，无论页面栈发生push还是pop操作均可生效
